function ImperialBasin() { 
  this.name = "Imperial Basin";
  var neighbors = new Array(
    "OldGap", "Arrakeen", "RimWallWest", "HoleInTheRock", "ShieldWall", 
    "FalseWallEast", "PolarSink", "Arsunt", "Carthag", "Tsimpo"
  );
  this.setNeighbors(neighbors);
}
